import React from 'react';
import './orders.css';

function Orders() {
    return (
        <div id="orders">
            <ul id="orders-list">
                <li>Completo - Nicolas</li>
                <li>Completo - Chanchito Feliz</li>
                <li>Hamburguesa - Felipe</li>
            </ul>
            <form>
                <input type="hidden" />
                <input id="submit" type="submit" />
            </form>
        </div>
    );
}

export default Orders;
